insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('139', 1, 'Notre étude propose ses services dans toute L’Algérie à une clientèle nationale et internationale, des clients privés, des entreprises et des communautés.\nNos services consistent en l’assistance-conseil juridique, la représentation en justice et auprès des autorités publiques dans des affaires de droit civil, administratif et pénal, l’élaboration d’expertises et la rédaction de contrats. Nous participons activement à des organes de décision d’entreprises et d’organisations diverses et à des tribunaux arbitraux.\nNous travaillons notamment dans les domaines du droit commercial (droit des sociétés et droits incorporels), droit des contrats, droit civil, droit de la construction, de l’aménagement du territoire et de l’expropriation ainsi que droit bancaire. Les feuilles de présentation montrent les domaines de prédilection des différents avocats. Lorsque des questions spécifiques ou les conditions géographiques l’exigent, nous faisons appel à notre réseau national et international de spéci', '139', 'francais', '710381021', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'immobilier, Droit des assurances, Droit des entreprises, Droit du sport, Droit du travail, Droit familial, Droit pénal', 139);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('140', 1, 'Cabinet d’avocats algériens à Rome – ITALIE spécialisé en droit des Entreprises, contrats de marché, crédits, ..ect', '140', 'francais', '756066904', 0, 'Droit civil, Droit commercial, Droit de la santé, Droit des entreprises', 140);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('141', 1, 'Monsieur, Madame J’ai l’honneur de proposer mes services auprès de vous que vous soyez particulier entreprise privé ou étatique. Avocat à la Cour Mon Cabinet vous offre une large gamme de services juridiques, également dans les matières controversées et complexes. J’agirais pour l’intérêt auxquels j’assure un accès immédiat à des conseils et à une assistance juridiques de haut niveau. Grace à mes diverses expériences cumulées dans des domaines professionnels variés, vous n’aurez pas à gaspiller votre temps précieux pour m’expliquer les spécificités de votre créneau ; je serais capable de les comprendre très rapidement, et donc d’être immédiatement opérationnels. Sachant que chaque entreprise est « unique » en son genre, je focalise mon travail sur la base de ses besoins particuliers et lui offrons des services adaptés.\nle Cabinet D’avocats Maitre hama boudjemaa offre à ses clients, outre des services de prévention comme la gestion des risques dans le cadre de la Responsabilité sociétal', '141', 'francais', '615295892', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'environnement, Droit de l\'immobilier, Droit de la consommation, Droit de la santé, Droit des assurances, Droit des entreprises, Droit des transports, Droit du sport, Droit du travail, Droit familial, Droit pénal, Droit routier', 141);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('142', 1, 'nan', '142', 'francais', '564354235', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'environnement, Droit de l\'immobilier, Droit de la consommation, Droit de la santé, Droit des assurances, Droit des entreprises, Droit des transports, Droit du sport, Droit du travail, Droit familial, Droit pénal, Droit routier', 142);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('143', 1, 'Maître Mohamed BRAHIMI, Avocat à la Cour de Bouira.\nAgréé à la Cour suprême et au Conseil d’Etat.\nMaître BRAHIMI Mohammed est issu de l’Ecole Nationale d’Administration, section judiciare, promotion 1980.\nMembre du barreau depuis 1992.\nIl a exercé dans la magistrature de 1980 à 1992. Il est auteur de plusieurs ouvrages de droit.\nIl a été notamment expert auprès de  l’Unité d’Appui au Projet  » Réforme de la justice en Algérie » dans le cadre du programme MEDA 2 piloté par la commission européenne.', '143', 'arabe', '522083536', 0, 'Droit administratif, Droit bancaire, Droit commercial, Droit de l\'immobilier, Droit des assurances, Droit des entreprises, Droit du travail, Droit familial, Droit pénal', 143);
