insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('145', 1, 'Notre cabinet intervient en tant que conseil et lors de procédures judicaires devant la plupart des juridictions Algériennes.\nNotre cabinet remplit essentiellement trois grandes fonctions auprès de ses clients : une fonction d’information et de conseil, une fonction de rédaction et de transaction, et enfin une fonction de représentation.\nAu titre de sa fonction d’information et de conseil, le Cabinet de Maître Abdeldjalil BELKHODJA vous informera sur les dernières évolutions légales et jurisprudentielles. Nous déterminons avec vous la solution adéquate à votre situation particulière et vous conseillons sur la meilleure voie à adopter pour la sauvegarde de vos droits et intérêts.\nLe cabinet de Maître Abdeldjalil BELKHODJA intervient également en qualité de rédacteur, pour tous courriers, contrats ou conventions. En effet, nous rédigerons pour votre compte toute correspondance utile auprès de vos interlocuteurs ou partenaires, ainsi que tout contrat ou transaction.\nLe cabinet de Maître A', '145', 'anglais', '732835453', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'environnement, Droit de l\'immobilier, Droit de la consommation, Droit de la santé, Droit des assurances, Droit des entreprises, Droit des transports, Droit du sport, Droit du travail, Droit familial, Droit pénal, Droit routier', 145);
