insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('149', 1, 'L’enracinement local, le positionnement unique et l’expertise reconnue permettent au cabinet AZRI AVOCATS de fournir des solutions innovantes et à haute valeur ajoutée en droit fiscal, en droit des affaires, en contentieux et arbitrage, en fusions acquisitions ainsi qu’en droit du tourisme.\nLa multi-expertise du cabinet et la valeur partagée du travail en équipe permet au cabinet AZRI AVOCATS de proposer à ses clients une offre juridique et fiscale globale. Cette approche représente pour les entreprises qui font confiance au cabinet l’assurance de disposer de solutions fiables et adaptées à chaque situation.', '149', 'anglais', '675722681', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'environnement, Droit de l\'immobilier, Droit de la consommation, Droit de la santé, Droit des assurances, Droit des entreprises, Droit des transports, Droit du sport, Droit du travail, Droit familial, Droit pénal, Droit routier', 149);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('150', 1, 'Le cabinet de Maitre RAHMOUNI SIDI MOHAMMED a été fondé en 2011 après quatre années de sciences Juridiques et Administratives et une anneè de certificat d’aptitude à la profession d’avocat plus un stage.\nson activité est celle d’un avocat généraliste ainsi le cabinet de Maître RAHMOUNI intervient dans de nombreux domaines du droit .\nLe Cabinet de Maître RAHMOUNI est une structure à taille humaine, conservant ainsi une qualité d’écoute,d’accessibilité et de réactivité dans le respect de la déontologie de la profession d’avocat. Le Cabinet vous représente avec honneur et probité dans la défense de vos intérêts, en vous conseillant les stratégies les plus adaptées tout en adoptant une politique de transparence et de modération en matière d’honoraires.', '150', 'francais', '695161684', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'environnement, Droit de l\'immobilier, Droit de la consommation, Droit de la santé, Droit des assurances, Droit des entreprises, Droit des transports, Droit du sport, Droit du travail, Droit familial, Droit pénal, Droit routier', 150);
