insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('154', 1, 'Notre Cabinet traite tous types de contentieux devant toutes les instances judiciaires algeriènnes.\nNous collaborons aussi avec un cabinet français implanté à paris, en particulier en matière de nationalité française et droits des étrangers.\nEn plus de nos activités judiciaires, notre cabinet est disposé également à défendre vos intérêts lors de l’élaboration des accords, conventions, contrats et toutes négociations avec vos partenaires sociaux, fiscaux, parafiscaux, par a une meilleure interprétation des lois en vigueur et nos judicieuses orientations.', '154', 'anglais', '781990749', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'environnement, Droit de l\'immobilier, Droit de la consommation, Droit de la santé, Droit des assurances, Droit des entreprises, Droit des transports, Droit du sport, Droit du travail, Droit familial, Droit pénal, Droit routier', 154);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('155', 1, 'Notre cabinet offre des services de conseils juridiques en matière de propriété intellectuelle, notamment des marques, de brevet d’invention et de dessins ou modèles ainsi du droit d’auteur et appellation d’origine, droits d’auteur et les droits voisins. Notre mandataire agréé est habilité à déposer des marques et tout autre signe distinctif à l’Institut National Algérien de la Propriété Industrielle (INAPI).\nPlusieurs sociétés étrangères et algériennes nous ont déjà fait confiance. Nos atouts sont la rapidité, la disponibilité et le meilleur prix!\nDéposez votre marque en Algérie est un droit, mais aussi une obligation, selon l’ordonnance 03-06 relative aux marques ! Alors pensez, sérieusement, à déposer vos marques, avant de commercialiser vos produits ou services en Algérie, car vous risquez le piratage et la contre façon.\nNotre cabinet ; agréé par le ministère de l’industrie et des mines en qualité de mandataire en propriété industrielle auprès de l’institut national de la propriété', '155', 'francais', '687559791', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'environnement, Droit de l\'immobilier, Droit de la consommation, Droit de la santé, Droit des assurances, Droit des entreprises, Droit des transports, Droit du sport, Droit du travail, Droit familial, Droit pénal, Droit routier', 155);
