insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('160', 1, 'le Cabinet vous offre ses services juridiques ,conseil et assistance qui répondent a vos besoins.\nNous intervenons tant après des juridictions de droit commun,tribunaux d’instance ,cour d’appel,tribunal administratif ,affaire sociale,affaire commerciale,affaire pénale …\nEn tenant compte des réglementations et de leurs évolution constante,nous vous aidons à construire les solutions adaptées à votre entreprise.', '160', 'francais', '665227276', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'environnement, Droit de l\'immobilier, Droit de la consommation, Droit de la santé, Droit des assurances, Droit des entreprises, Droit des transports, Droit du sport', 160);
