insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('162', 1, 'Maître Abdelhafidh MOHAMMED-SEBAA est avocat à la Cour. Inscrit à l’ordre des avocats de Mostaganem.\nA travers ses expériences pratiques et ses connaissances professionnelles, Maître Abdelhafidh MOHAMMED-SEBAA met à la disposition de ses clients, ses services en matière de conseil juridique et d’accompagnement dans le contentieux en garantissant la meilleure réactivité possible, et en s’engageant à défendre les intérêts de ses clients dans la durée.\nAu service des collectivités publiques, des entreprises et des particuliers, le Cabinet offre un centre de solutions et un panel de réponses pour intervenir à vos côtés dans un souci d’efficacité, de proximité, de terrain et de réactivité.\nC’est ainsi que le Cabinet est à votre disposition pour vous conseiller et vous accompagner dans le contentieux.\nDynamisme, expérience et disponibilité; Maître Abdelhafidh MOHAMMED-SEBAA vous apporte le soutien d’un Cabinet pluridisciplinaire.', '162', 'francais', '533142657', 0, 'Droit administratif, Droit civil, Droit commercial, Droit de l\'immobilier, Droit des assurances, Droit des entreprises, Droit du travail, Droit familial, Droit pénal', 162);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('163', 1, 'Le Cabinet Zouaid, est un Cabinet d’Avocats situé à Bouira (100 kms d’Alger).\nLa compétence territoriale de l’avocat en Algérie étant totale. Le Cabinet intervient dans plusieurs wilayas principalement à:\n\nBouira\nAlger\nTizi-Ouzou\nBoumerdès\nBlida\nBéjaia\nSétif\nBord bouariridj\n\nle Cabinet, en effet, se charge du suivi des affaires de ses clients dans toutes les phases du litige (consultations et conseils, rédaction d’actes et plaidoiries devant les juridictions).\nIl intervient dans plusieurs domaines du droit (droit civil, droit commercial, droit des sociétés, droit social, droit de la famille, droit international privé, droit pénal et contentieux administratif).\nLe Cabinet travaille en outre en étroite collaboration avec des Etudes de Notaires, des Experts Comptables et des Experts fonciers, en Algérie, lorsque la situation exige de faire appel à ces professionnels.', '163', 'arabe', '697013907', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'immobilier, Droit des assurances, Droit des entreprises, Droit du travail, Droit pénal', 163);
