insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('229', 1, 'Nous sommes :\nUn cabinet d’avocats international indépendant spécialiste du droit algérien, du droit libyen, et du droit marocain.  \nLe cabinet est spécialisé quasi exclusivement dans le droit et la fiscalité des pays du Maghreb (Algérie Libye, Maroc), et dans le droit international des relations économiques..\nUn cabinet d’avocats international offrant des services adaptés et créateurs de valeur  \nLe cabinet  se distingue par la connaissance approfondie qu’ont ses membres des spécificités juridiques, fiscales et aussi culturelles de l’Algérie, de la Libye,et  du Maroc..\nLe cabinet est de ce fait apte à apporter à ses clients, au moyen d’une assistance personnalisée de qualité, des solutions pratiques et innovantes.\nDans sa démarche de conseil, le cabinet conçoit le droit comme un instrument de la stratégie de l’entreprise et de création de valeur. \nUn cabinet d’avocats international possédant des compétences internationalement reconnues  \nLe cabinet bénéficie d’une compétence reconnue ', '229', 'arabe', '632820187', 0, 'Droit des investissements', 229);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('230', 1, 'La societé Bouziane et Mokhtari est une societé d’avocats Algériens , indépendante et dédiée au droit des affaires, accompagnant une clientèle Algérienne et international\n1-La mission de la société\nParce que l’ignorance des règles juridiques peut entraîner des conséquences irréversibles pour l’entreprise, la mission de la société est de :\nDéterminer avec l’entrepreneur la faisabilité de son projet\nDe l’informer de ses droits et obligations compte tenu de l’évolution constante de règles juridiques,\nDe lui apporter la garantie juridique lui permettant de créer et protéger sa structure\nDe le défendre en cas de litige', '230', 'francais', '625333913', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'environnement, Droit de l\'immigration, Droit de l\'immobilier, Droit de la consommation, Droit de la propriété intellectuelle, Droit de la santé, Droit des assurances, Droit des contrats, Droit des énergies, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, Droit des transports, droit douanier, Droit du sport, Droit du travail, Droit familial, Droit foncier, Droit international privé, Droit judiciaire, Droit maritime, Droit pénal, Droit routier, Droit social', 230);
