insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('243', 1, 'Avocate ayant prêter serment en 2010, je dispose d’un cabinet sis à côté du nouveau tribunal de cheraga, avec une bonne expérience comme juriste de banque et d’entreprise, je donne les avis juridiques par Mail en langue arabe ou française, je travaille sur les règlements à l’amiable, le pré-contentieux ainsi que le contentieux dans toutes les branches de droit,je prend en charge toutes les Affaires de droits particuliers et entreprises ( sociales, commerciales, pénales… etc).\nJe me déplace pour des réunions mensuelles ou hebdomadaires entre (avocat-Entreprise).\nPour plus d’informations merci de me contacter sur le numéro citer ci-dessous ou adresse Mail.', '243', 'arabe', '582664413', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'environnement, Droit de l\'immigration, Droit de la santé, Droit des assurances, Droit des contrats, Droit des sociétés, Droit des transports, Droit du sport, Droit du travail, Droit familial, Droit judiciaire, Droit pénal, Droit social', 243);
