insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('245', 1, 'L’un des premiers cabinets en droit des affaires en Algérie, combinant expertise juridique et parfaite connaissance du pays.\nNotre cabinet a ouvert en 2007 un bureau à Alger pour y accompagner ses clients dans la réalisation de leurs projets et notamment, en matière d’opérations internationales, d’investissements étrangers en Algérie et algériens à l’étranger, dans les secteurs de l’immobilier, des énergies renouvelables et des opérations de financement.\nNotre cabinet est le conseil de ministères et d’administrations, d’entreprises publiques, de banques multilatérales, de groupes internationaux, d’institutions financières et d’entreprises industrielles.\nNotre cabinet assiste également ses clients au contentieux, que ce soit devant les juridictions algériennes ou arbitrales.\nNos avocats travaillent en étroite collaboration avec nos équipes basées à Paris et également avec nos autres bureaux en Afrique, en Asie et au Moyen-Orient.', '245', 'anglais', '672065452', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'environnement, Droit des assurances, Droit des contrats, Droit des énergies, Droit des entreprises, Droit des fusions et acquisitions, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, Droit du travail, Droit international privé', 245);
