insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('248', 1, 'Notre cabinet fournit des services à de nombreuses entreprises dans plusieurs secteurs (automobile, ingénierie, construction, pharmaceutique, Télécom, publicité, etc …);\nNous apportons également une assistance quotidienne sur les questions juridiques et réglementaires pour les grands groupes internationaux ayant investi en Algérie ou souhaitant investir dans ce pays, ainsi que pour les institutions et entreprises publiques et privées algériennes;\nNous sommes en mesure de représenter nos clients auprès les tribunaux, cela nous permet de fournir les services les plus avantageux et complets sur le marché.', '248', 'anglais', '692001825', 0, 'Droit Affaires, Droit commercial, Droit de fusions et acquisitions, Droit de l\'immigration, Droit de la santé, Droit des contrats, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des sociétés, Droit du travail, Droit familial, Droit social', 248);
