insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('250', 1, 'PRÉSENTATION\nLe cabinet de Maître Fayçal Megherbi, vous accueille au 76 Rue Réaumur à Paris.\nMaître Fayçal Megherbi est Docteur en Droit.\nLe cabinet est situé à deux pas de la station de Métro « Réaumur – Sébastopol » (lignes 3 et 4).\nLe cabinet intervient en tant que conseil et lors de procédures judiciaires devant la plupart des juridictions françaises, notamment en droit des étrangers et de la nationalité, en droit pénal et en droit public.\nLes fonctions de notre cabinet sont triples : Tout d’abord, nous assurons un rôle d’information et de conseil auprès de nos clients. Ensuite nous intervenons à titre de rédacteur de négociateur aux cotés de nos clients. Enfin, nous représentons nos clients devant les juridictions en agissant pour leur compte et en assurant la défense de leurs intérêts.\nAu titre de sa fonction d’information et de conseil, le Cabinet vous informera sur les dernières évolutions légales et jurisprudentielles. Nous déterminons avec vous la solution adéquate à votre si', '250', 'arabe', '670505584', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'environnement, Droit de l\'immigration, Droit de l\'immobilier, Droit de la consommation, Droit de la propriété intellectuelle, Droit de la santé, Droit des assurances, Droit des contrats, Droit des énergies, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, Droit des transports, droit douanier, Droit du sport, Droit du travail, Droit familial, Droit foncier, Droit international privé, Droit judiciaire, Droit maritime, Droit pénal, Droit routier, Droit social', 250);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('251', 1, 'Crée de fait depuis 1989,agrée depuis 2007,par le Conseil de l’Ordre des Avocats de Tizi Ouzou, après la dissolution de la Société Civile Professionnelle d’Avocats,le Cabinet DAOUDI a connu un développement constant grâce à la qualité de sa clientèle et la disponibilité de ses membres.\nPratiquant essentiellement le droit des affaires,le Cabinet DAOUDI intervient tant en Conseil, négociation que Contentieux auprès de sa clientèle composée de banques ( CPA-BDL-BADR-BNA-BEA-BNP Paribas) de sociétés pétrolières ( Groupe SONATRACH-Groupe ENSP-ENAGEO-ENAC)de sociétés de construction ( COSIDER-SAPTA)de sociétés industrielles(Groupe ENAD-ENAD-SIDET-ENAD-SODER-ENIEM-ERIAD BOUIRA-ENRI).\nGrâce à un logiciel spécial crée par LOGISAM,la clientèle du Cabinet DAOUDI a la faculté de suivre sur le Web,l’évolution des affaires confiées par elle à ce Cabinet, de connaitre le contenu des écritures échangées entre les parties devant les juridictions concernées et les décisions judiciaires rendues et ce, en', '251', 'francais', '527909932', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'environnement, Droit de l\'immigration, Droit de l\'immobilier, Droit de la consommation, Droit de la propriété intellectuelle, Droit de la santé, Droit des assurances, Droit des contrats, Droit des énergies, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, Droit des transports, droit douanier, Droit du sport, Droit du travail, Droit familial, Droit foncier, Droit international privé, Droit judiciaire, Droit maritime, Droit pénal, Droit routier, Droit social', 251);
