insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('255', 1, 'Fondé par deux avocats très expérimentés disposant d’une formation et d’une expérience professionnelle algérienne, française et anglo-saxonne dans de prestigieuses universités et des cabinets d’affaires internationaux à Alger, Paris et Londres, Bourabiat Associés a pour vocation d’offrir à ses clients une offre se voulant pionnière en Algérie combinant l’assistance d’un Cabinet totalement indépendant, solidement ancré localement et offrant à ses clients des prestations juridiques et un service conformes aux standards internationaux dans la plupart des disciplines du droit des affaires.\nLe Cabinet intervient en Algérie, en France et dans l’ensemble de la zone MENA en s’appuyant notamment sur des partenariats avec des cabinets de premier plan dans les juridictions concernées permettant ainsi d’accompagner ses clients dans leurs transactions et projets transfrontaliers.\nDomaines d’expertise\nDroit bancaire et financier\nLe droit bancaire et financier et les opérations de restructuration con', '255', 'francais', '672550472', 0, 'Droit bancaire, Droit de fusions et acquisitions, Droit des énergies, Droit des entreprises, Droit des investissements, Droit social', 255);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('256', 1, 'Avocate agréée près de la Cour Suprême et du Conseil d’État, ayant à son actif une longue expérience de 16 ans au Barreau, ainsi qu’une vaste expérience en: Droit Civil, Foncier, Commerciale, Pénale, et administratif, dans la rédaction de différents Contrats et Marchés, car ayant longuement accompagné les Sociétés étrangères en Algérie dans la création de ces dernières, dans la création de bureaux de liaisons, dans le règlement de différents Litiges, entre Sociétés, ainsi qu’ entre Sociétés et particuliers ou Administrations.\nيتشرف مكتب المحامية المعتمدة لدى المحكمة العليا و مجلس الدولة بتقديم جميع الاستشارات القانونية والادارية وكدا ثمثيل المواطنين امام المحاكم والمجالس القضائية والادارات في مختلف الميادين على مستوى جميع المحاكم و المجلس القضائية نختص في الدعاوى المدنية  » تصحيح الاخطاء المادية كالاسماء الالقاب الشهادات الادارية دعاوى الايجار وغيرها القضايا التجارية دعاوى الشركات قضايا الاسرة دعاوى الطلاق ، النفقة المواريث الدعاوى العمالية القضايا الادارية، المدنية، العقارية والجزائية', '256', 'francais', '524326734', 0, 'Droit administratif, Droit Affaires, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'environnement, Droit de l\'immigration, Droit de l\'immobilier, Droit de la consommation, Droit de la propriété intellectuelle, Droit de la santé, Droit des assurances, Droit des contrats, Droit des énergies, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, Droit des transports, droit douanier, Droit du travail, Droit familial, Droit foncier, Droit international privé, Droit judiciaire, Droit maritime, Droit pénal, Droit routier, Droit social', 256);
