insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('260', 1, 'Avocats avec bureau dans la capitale de la céramique de l’Espagne (Castellón), offrent leurs services professionnels aux citoyens algériens qui veulent vivre, investir, créer des entreprises ou acheter de l’immobilier, traiter un permis de séjour, travailler, assurance maladie…\nNous traitons tout ce qui est nécessaire en Espagne et au consulat général d’Espagne à Alger.\nAttention professionnelle\nNous répondons à l’email, au téléphone, au WhatsApp et au Telegram.', '260', 'francais', '764151731', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit commercial, Droit de l\'immigration, Droit de l\'immobilier, Droit de la santé, Droit des assurances, Droit des contrats, Droit des entreprises, Droit des étrangers, Droit des investissements, Droit international privé', 260);
