insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('262', 1, 'Le cabinet d’avocat Me TAIEB, est situé au 39, Rue Gharbi Guemraoui, Bouira (à 100 km d’Alger).\nLe cabinet connaît un développement constant et son équipe se compose d’avocats et d’assistants dynamiques et réactifs afin de répondre aux besoins de ses clients.\nIl intervient dans plusieurs domaines: droit civil, droit Commercial et des sociétés, droit social, droit de la famille et droit international privé, droit pénal et contentieux administratif).\nNotre cabinet travaille en étroite collaboration avec des notaires, des experts comptables et fonciers, lorsque la situation exige de faire appel à ces professionnels.\nLe cabinet intervient dans plusieurs wilayas, principalement à Bouira, Alger, Tizi-Ouzou, Boumerdès, Blida, Béjaia, Média, M’sila, Sétif et Bordj Bou Arréridj.', '262', 'anglais', '597289254', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de l\'immobilier, Droit de la propriété intellectuelle, Droit de la santé, Droit des assurances, Droit des contrats, Droit des recouvrement de créances, Droit des sociétés, Droit du travail, Droit familial, Droit foncier, Droit pénal, Droit social', 262);
