insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('291', 1, 'Maître HARZI Saliha Cabinet avocate agrée à la cour de Ouargla, Hassi Messaoud et Touggourt.\nMet au service des entreprises et sans oublions les particuliers ses compétences dans les spécialités suivantes ;\n-Droit civil\n-Droit pénal\n-Droit Fiscal\n-Droit du travail\n-Droit commercial\n-Administratif\n-Statut personnel\nLe cabinet il assure la défense des intérêts de ses clients devant les juridictions Contentieux, le cabinet prend en charge toutes les affaires relatives au droit de la famille, divorce, droit de garde, pension alimentaire.\nNotre cabinet est situé à la cité Sidi Abdelkader (en face la maison de jeunes) Ouargla.', '291', 'arabe', '541420311', 0, 'Droit administratif, Droit civil, Droit commercial, Droit du travail, Droit pénal', 291);
