insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('310', 1, 'QUI SOMMES NOUS\nAprès avoir exercé en qualité de collaborateur au sein de plusieurs cabinets d’avocats d’affaires spécialisés en droit public des affaires ainsi qu’en droit de l’environnement, Daoud ACHOUR a créé son propre cabinet.\nLa particularité du cabinet d’avocat Daoud ACHOUR est d’offrir une expertise très complète en droit public. Ainsi le cabinet Daoud ACHOUR ne se cantonne pas à un champ précis du droit public. Bien au contraire le Cabinet Daoud ACHOUR est à même de pouvoir aborder une problématique juridique dans toute sa complexité qu’elle soit contractuelle, environnementale, réglementaire. Cette vision à 360 degrés se révèle capitale dans un environnement juridique de moins en moins sécurisant pour les personnes publiques et les opérateurs économiques. En effet, la forte inflation législative et réglementaire nécessite de bénéficier d’une expertise complète approfondie telle qu’est capable de l’offrir le cabinet d’avocat Daoud ACHOUR.', '310', 'francais', '776731677', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de l\'immobilier, Droit des contrats, Droit des investissements, Droit des sociétés, Droit du travail, Droit familial, Droit judiciaire, Droit pénal', 310);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('312', 1, 'Présentation\nAprès avoir effectué un master en droit algérien et en droit suisse, Maître Lachemi Belhocine ouvre son étude le 1er février 2002, dès l’obtention de son brevet fédéral d’avocat.\nAssocié à Maître Philippe Burgener inscrit au barreau du Luxembourg, Me Belhocine est un avocat généraliste, même si ses domaines de prédilection sont le droit du bail et le droit de la construction.\nIl détient également une autorisation Schengen qui lui permet d’intervenir et de plaider dans toute la zone Schengen.\nAutre plus-value : Maître Belhocine parle français, arabe, allemand et espagnol.', '312', 'francais', '665396086', 0, 'Droit administratif, Droit civil, Droit pénal', 312);
