insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('314', 1, 'Samir Sayah a rejoint CMS Francis Lefebvre Algérie Conseil juridique et fiscal en 2006.\nAvec une équipe pluridisciplinaire et multiculturelle de 11 juristes et fiscalistes polyglottes, notre bureau constitue l’un des rares cabinets en Algérie à pouvoir proposer une assistance juridique et fiscale couvrant les principaux domaines des droits algérien et international de la finance et des affaires.\nFormation\nLicence en droit des sciences administratives de l’Université d’Alger\nTitulaire du certificat d’aptitude à la profession d’avocat (CAPA)\nPublications\nArticles pour le site Droit Algérie Articles sur la fiscalité algérienne dans la brochure et les Flashs CMS Tax Connect\nMise à jour du guide « S’implanter en Algérie » – Mission économique française (2008/2009)\nCo-auteur de la Newsletter CMS Francis Lefebvre Algérie Conseil juridique et fiscal et de « La fiscalité et la promotion de l’investissement en Algérie » (Business Oxford Review Group 2005)\nRédacteur en chef de l’ouvrage « Hydroca', '314', 'arabe', '582189685', 0, 'Droit Affaires, Droit bancaire, Droit commercial, Droit des assurances, Droit des contrats, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés', 314);
