insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('317', 1, 'La cabinet d’avocat Hached à Paris a été créé en 1998 afin d’assister et accompagner juridiquement dans différents domaines expertises. Si vous cherchez un avocat en divorce à Paris, un avocat en droit des étrangers, en droit de la nationalité ou encore un avocat en droit du travail, le cabinet peut vous assister.\nAvocats Paris, nous intervenons sur l’ensemble du territoire français, comme nous accompagnons nos clients à l’international. Le cabinet HACHED dispose d’une expertise dans plusieurs domaines du droit ::\n–\tAvocat en Droit des étrangers : nous accompagnons les sans papiers dans leurs démarches de régularisation administrative. Comme, nous assistons et représentons nos clients ayant fait objet d’une Obligation de Quitter le Territoire Français(O.Q.T.F) devant les tribunaux administratifs sur l’ensemble du territoire français..\n–\tAvocat en droit de la nationalité française : Avocats à Paris spécialistes de la nationalité française, nous conseillons les étrangers sur les différen', '317', 'arabe', '798967990', 0, 'Droit Affaires, Droit de la presse, Droit des étrangers, Droit du travail, Droit familial, Droit international privé', 317);
