insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('324', 1, 'Cabinet d’avocats d’affaires international, SRDB Law Firm accompagne les entreprises, leurs dirigeants, des décideurs et des Etats, en France et à travers le monde.\nSRDB Law Firm propose à ses clients les meilleurs experts pour servir leur développement et la défense de leurs intérêts.\nSRDB ouvre un bureau en Algérie pour accompagner les entreprises qui investissent dans ce pays.\nAprès l’ouverture en décembre 2016 d’un bureau en Iran, SRDB Avocats & Associés spécialiste des projets juridiques internationaux et la résolution de litiges en France, au Moyen Orient, et en Afrique du Nord et Asie poursuit sa croissance en s’installant en Algérie.\nLe Cabinet vient de signer un contrat de partenariat avec SBB Partners, l’un des cabinets les plus réputés d’Algérie fondé par l’actuel Bâtonnier d’Alger, Me Abdelmajid Silini.\nSRDB – SBB Algérie dispose d’une équipe de 30 avocats d’excellence sur place dont, outre le Bâtonnier, 2 avocats de renom : Me Mohamed Baghdadi, membre du Conseil de l’Ordre', '324', 'arabe', '750863160', 0, 'Droit Affaires, Droit bancaire, Droit commercial, Droit de fusions et acquisitions, Droit des assurances, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, Droit des transports, droit douanier, Droit international privé, Droit maritime', 324);
