insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('329', 1, 'Fondé en 2006, par Maitre Kouceila ZERGUINE, le cabinet est composé de plusieurs avocats inscrits au Barreau d’Algérie, ainsi d’avocats collaborateurs, spécialistes sur multiples domaines juridiques, tels que l’arbitrage, droits contractuelles et contentieuses relatives à la vie des entreprises.telechargement-3\nLe cabinet s’est spécialisé dans le droit des affaires, et du commerce. Il compte parmi les rares cabinets d’avocats Algériens indépendants de référence.\nLe cabinet assiste et guide les entreprises nationales et internationales dans leurs démarches d’investissements et d’installation, il intervient régulièrement dans le cadre d’opérations complexes à forte valeur ajoutée nécessitant des compétences techniques spécialisées et pluridisciplinaires.', '329', 'arabe', '795227517', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'environnement, Droit de l\'immigration, Droit de l\'immobilier, Droit de la consommation, Droit de la presse, Droit de la propriété intellectuelle, Droit de la santé, Droit des assurances, Droit des contrats, Droit des énergies, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, Droit des transports, droit douanier, Droit du sport, Droit du travail, Droit familial, Droit foncier, Droit international privé, Droit judiciaire, Droit maritime, Droit pénal, Droit routier, Droit social, Droits de l\'homme', 329);
