insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('339', 1, 'Fondé et dirigé par Maître Dali Hichem, avocat à la cour d’appel d’Annaba (Algérie) inscrit au Barreau de Annaba. Notre cabinet intervient principalement en droit des affaires, en droit administratif, en droit foncier, en droit maritime. Le cabinet intervient aussi dans les missions de conseil, assistance, représentation des entreprises.\nNotre approche des dossiers, notre état d’esprit et notre expériences sont un atout majeur dont nous faisant bénificier notre clientèle. Notre couverture du droit nous permettre d’assister et de défendre nos clients aussi bien dans le cadre de négociations que devant les juridiques, de sorte que nous sommes à même de garantir au chef d’entreprise un suivi complet de ses affaires.\nFace à des normes juridiques de plus en plus nombreuses et complexes, l’avocat doit avoir pour première mission d’informer et de conseiller son client.\nOBJECTIF\nL’objectif du cabinet DALI Hichem est d’apporter, tant conseil qu’en contentieux, un service adapté aux réalités de ', '339', 'francais', '784092210', 0, 'Droit administratif, Droit Affaires, Droit foncier, Droit maritime', 339);
