insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('341', 1, 'Généraliste en droit privé et droit public, je vous informe et vous conseille pour gérer les difficultés de la vie quotidienne, privées ou professionnelles, devant toute les instances judiciaires national, ordinaires et administratifs\nJe vous propose une assistance personnalisée et la garantie d’un interlocuteur de référence constant, tant en conseil qu’en contentieux, en développant une offre globale de services juridiques qui repose sur des pôles de compétences.\nVous aurez ainsi une réponse pragmatique et opérationnelle à vos questions et problématiques juridiques basée sur une approche et une méthodologie de travail résolument tournées vers ses clients.', '341', 'arabe', '729827737', 0, 'Droit administratif, Droit Affaires, Droit civil, Droit commercial, Droit de l\'immobilier, Droit de la consommation, Droit de la santé, Droit des assurances, Droit des contrats, Droit des entreprises, Droit des étrangers, Droit des investissements, Droit des recouvrement de créances, Droit des sociétés, droit douanier, Droit du sport, Droit familial, Droit foncier, Droit maritime, Droit pénal, Droit routier', 341);
