insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('349', 1, 'Consultez la fiche d’entreprise AIT AMAR SAMIR Avocats spécialistes en droit commercial Alger\nAssistance et Conseils\nNous assistons les entreprises nationales et etrangéres et les Ambassades par nos conseils verbaux et écrits sur les solutions à donner à tous problèmes de droit des la naissance de l’entreprise.\nnotamment en les matières de droit ci-après :\n• droit Commercial et droit des assurances\n• droit du Travail\n• droit Civil\n• droit foncier, achat vente et location d’immeuble\n• droit Pénal\n• droit Administratif et marchés publics\nDéfense en Justice\nNous engageons toute action ou défense en justice devant les juridictions compétentes, pour obtenir ou défendre les intérêts matériels et moraux des entreprises nationales et étrangères.\nNous représentons nos clients auprès de toutes juridictions et auprès des tiers pour formaliser et engager toute demande ou toute défense, dans le respect des lois et règlements en vigueur en Algérie.\nAutres questions juridiques intéressant la défense ', '349', 'francais', '517855820', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit commercial', 349);
