insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('417', 1, 'Notre cabinet accompagne depuis près d’une trentaine d’années des clients et partenaires nationaux et internationaux pour des prestations de conseil et d’assistance en toutes branches du droit.\nCette pluridisciplinarité s’accompagne d’une grande fiabilité des recommandations, une appréhension globale des dossiers, une réactivité, et une écoute pour une relation personnalisée.\nNotre cabinet bénéficie aujourd’hui d’une forte identité, grâce aux compétences de son équipe , garante d’un standard de prestations de qualité dont nos clients et partenaires sont en droit d’être en attente.', '417', 'francais', '787697527', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de la propriété intellectuelle, Droit des contrats, Droit des énergies, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, Droit des transports, Droit du sport, Droit du travail, Droit international privé, Droit maritime', 417);
