insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('420', 1, 'Avocate à la cour (Oran).\nJe présente mes services juridiques à tout moment et je serais à votre disposition. Soyez les bienvenus.\nFORMATION:\n– Licence en Droit.\n– Certificat d’Aptitude de la Profession d’Avocat.\n– Cadre Juridique à EURL CECOS International en 2014 jusqu’à 2015.\n– Formation de la langue Anglaise au Centre CEIL d’Oran.', '420', 'anglais', '793547987', 0, 'Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'immigration, Droit de l\'immobilier, Droit de la propriété intellectuelle', 420);
