insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('424', 1, 'Cabinet maître derkaoui djillali.\nAvocat agréé à la cour suprême et conseil d’état.\nAvocat inscrit au grand tableau de l’ordre des avocats de Sidi bel abbés.\nAvocat membre de l’ UIA (( union internationale des avocats )) et ex membre de son comité national.\nTel/fax : 0021343783814\nViber / WhatsApp : 00213771179690', '424', 'anglais', '511721204', 0, 'Droit administratif, Droit bancaire, Droit civil, Droit commercial, Droit de l\'immigration, Droit de l\'immobilier, Droit de la consommation, Droit des assurances, Droit des contrats, Droit des entreprises, Droit des étrangers, Droit des investissements, Droit des sociétés, Droit du travail, Droit familial, Droit foncier, Droit international privé, Droit judiciaire, Droit maritime, Droit pénal, Droit routier, Droit social', 424);
insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('425', 1, 'Avocat agréé à la cour suprême et au conseil d’état, s’est forgé une expérience accrue dans le domaine du droit des affaires, aussi les autres domaines de droit plus généralistes au bien de ses clients: entreprises algériennes publiques ou privées , administrations publiques et particuliers.\nNous aidons les entreprises et les sociétés algériennes/étrangères à s’installer et s’implanter en Algérie et les accompagnons /conseillons tout au long des processus, de l’installation, pendant la période d’activité et les aidons ou représentons devant les instances judiciaires et administratives en cas de conflits/litiges contre d’autres sociétés, administrations ou particuliers.\n01 – droit civil.\n02 – droit de la famille.\n03 – droit commercial.\n04 – droit des assurances.\n05 – droit bancaire et financier.\n06 – droit des sociétés.\n07 – droit du travaille et la sécurité sociale.\n08 – droit foncier.\n09 – droit de la propriété intellectuelle.\n10 – droit de la concurrence.\n11 – droit pénal des affaire', '425', 'anglais', '761724585', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'immobilier, Droit de la propriété intellectuelle, Droit de la santé, Droit des assurances, Droit des contrats, Droit des entreprises, Droit des investissements, Droit des recouvrement de créances, Droit des sociétés, Droit des transports, droit douanier, Droit du travail, Droit familial, Droit foncier, Droit international privé, Droit judiciaire, Droit maritime, Droit pénal, Droit social, Droits de l\'homme', 425);
