insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('485', 1, 'Notre étude propose ses services dans toute L’Algérie à une clientèle nationale et internationale, des clients privés, des entreprises et des communautés.\nNos services consistent en l’assistance-conseil juridique, la représentation en justice et auprès des autorités publiques dans des affaires de droit civil, administratif et pénal, l’élaboration d’expertises et la rédaction de contrats. Nous participons activement à des organes de décision d’entreprises et d’organisations diverses et à des tribunaux arbitraux.\nNous travaillons notamment dans les domaines du droit commercial (droit des sociétés et droits incorporels), droit des contrats, droit civil, droit de la construction, de l’aménagement du territoire et de l’expropriation ainsi que droit bancaire. Les feuilles de présentation montrent les domaines de prédilection des différents avocats. Lorsque des questions spécifiques ou les conditions géographiques l’exigent, nous faisons appel à notre réseau national et international de spéci', '485', 'arabe', '738119964', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'environnement, Droit de l\'immigration, Droit de l\'immobilier, Droit de la consommation, Droit de la presse, Droit de la propriété intellectuelle, Droit de la santé, Droit des assurances, Droit des contrats, Droit des énergies, Droit des entreprises, Droit des étrangers, Droit des fusions et acquisitions, Droit des investissements, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, Droit des transports, droit douanier, Droit du sport, Droit du travail, Droit familial, Droit foncier, Droit international privé, Droit judiciaire, Droit maritime, Droit pénal, Droit routier, Droit social, Droits de l\'homme', 485);
