insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('496', 1, 'Le Cabinet Maître TAIEB – Avocat agréé près de la Cour Suprême et le Conseil d’État – est un Cabinet d’Avocats situé à Bouira (100 kms d’Alger).\nLa compétence territoriale de l’Avocat, en Algérie, étant totale, le Cabinet intervient dans plusieurs wilayas, principalement à Bouira, Alger, Tizi-Ouzou, Boumerdès, Blida, Béjaia, Sétif et Bord Bouariridj.\nLe Cabinet, en effet, se charge du suivi des affaires de ses clients dans toutes les phases du litige (consultations et conseils, rédaction d’actes et plaidoiries devant les juridictions). Il intervient dans plusieurs domaines du droit (Droit civil, Droit commercial et des sociétés, droit social, droit de la famille et droit international privé, droit pénal et contentieux administratif).\nLe Cabinet travaille en outre en étroite collaboration avec des Etudes de Notaires, des Experts Comptables et des Experts fonciers, en Algérie, lorsque la situation exige de faire appel à ces professionnels.', '496', 'anglais', '621849699', 0, 'Droit administratif, Droit Affaires, Droit bancaire, Droit civil, Droit commercial, Droit de fusions et acquisitions, Droit de l\'immobilier, Droit de la propriété intellectuelle, Droit de la santé, Droit des assurances, Droit des contrats, Droit des entreprises, Droit des sociétés, Droit des Telecom/TIC, Droit des transports, Droit du travail, Droit familial, Droit foncier, Droit maritime, Droit pénal, Droit social', 496);
