insert into `core_lawyerprofile` (`address_id`, `approved`, `bio`, `id`, `language`, `phone_number`, `rating`, `specialization`, `user_id`) values ('506', 1, 'bourebi billal\nConseil juridique/avocat chez Cabinet d’avocat\nTâches principales :\n– Prendre toute mesure et intervenir dans tout acte de procédure ;\n– Exercer tout recours ;\n– Donner ou recevoir tout paiement et quittance ;\n– Accomplir tout acte comportant l’abandon ou la reconnaissance d’un droit ;\n– Diligenter la procédure d’exécution de toute décision de justice.\n Domaine droit privé :\n1. S’occuper au départ des contrats entre particuliers ;\n2. Être un conseiller en négociations, rédaction de contrats de travail, rédaction d’actes, statuts de sociétés, transaction ;\n3. Faire valoir les droits de ses clients et ses conclusions (prétentions du client).\n Domaine droit public :\n4. Défendre les citoyens face à l’Etat ;\n5. Se mettre en relation directement avec les tribunaux administratifs ;\n6. Faire des demandes de lois, décrets, normes et autres qui ont effet sur les citoyens en général. Tous les résultats des\naccusations de la part d’un citoyen vers l’État, seront applicables pour t', '506', 'francais', '616082237', 0, 'Droit administratif, Droit civil, Droit commercial, Droit de l\'immobilier, Droit de la consommation, Droit de la presse, Droit des assurances, Droit des contrats, Droit des entreprises, Droit des étrangers, Droit des privatisations, Droit des recouvrement de créances, Droit des sociétés, droit douanier, Droit du travail, Droit familial, Droit foncier, Droit judiciaire, Droit pénal, Droit social', 506);
